-- 表结构导出
DROP TABLE IF EXISTS `dim_country`;
CREATE TABLE `dim_country` (
  `country_id` int NOT NULL AUTO_INCREMENT,
  `country_code` varchar(10) DEFAULT NULL,
  `countryName` varchar(100) NOT NULL COMMENT '国家名称',
  `country_name_cn` varchar(100) DEFAULT NULL,
  `region_id` int DEFAULT NULL,
  `continent` varchar(50) DEFAULT NULL COMMENT '所属大洲',
  `is_active` tinyint(1) DEFAULT '1',
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updatedAt` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`country_id`),
  UNIQUE KEY `countryName` (`countryName`),
  KEY `idx_country_name` (`countryName`),
  KEY `idx_country_region` (`region_id`),
  KEY `idx_country_active` (`is_active`),
  CONSTRAINT `dim_country_ibfk_1` FOREIGN KEY (`region_id`) REFERENCES `dim_region` (`region_id`)
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='国家维度表';

